import React from 'react';
import NFTCard from './NFTCard.jsx'

function Gallery(props) {
    let nftList = props.list;
    return (
        <NFTCard imgURL={nftList[0].media[0].gateway} name={props.list[0].title}></NFTCard>
    );
}
export default Gallery;
